import React from 'react'
import { useSelector } from 'react-redux'
import { Link } from 'react-router-dom'
import MarkerIcon from '../assets/marker.png'
import MarkerIconSelected from '../assets/marker-selected.png'

const Marker = ({ store }) => {
    const { storeMapSelected } = useSelector((state) => state.shop);

    return (
        <Link to={`/store/${store._id}`}>
            <div>
                <img src={storeMapSelected === store._id ? MarkerIconSelected : MarkerIcon} 
                alt="ok" />
                <img src={store.logo} alt="ok"
                    className="img-marker" />
            </div>
        </Link>
    );
}

export default Marker;
